import React, { useState } from 'react';
import axios from 'axios';
import { Form, Button, Container, Row, Col, Card } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const AddEmployee = () => {
  const [form, setForm] = useState({
    titleBefore: '',
    firstName: '',
    lastName: '',
    titleAfter: '',
    birthSurname: '',
    birthNumber: '',
    nationality: '',
    birthDate: '',
    birthCountry: '',
    idType: '',
    taxDomicile: '',
    usaResident: 'no',
    phone1: '',
    phone2: '',
    landline: '',
    email: '',
    addressType: '',
    street: '',
    houseNumber: '',
    city: '',
    zip: '',
    country: ''
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5001/api/employees', form);
      alert('Zamestnanec bol vytvorený');
      navigate('/employees');
    } catch (error) {
      console.error(error);
      alert('Chyba pri ukladaní profilu');
    }
  };

  return (
    <Container className="mt-5">
      <Card className="p-4 shadow">
        <h2 className="text-center mb-4">Vytvoriť nový profil</h2>
        <Form onSubmit={handleSubmit}>
          <Row>
            <Col><Form.Group><Form.Label>Titul pred menom</Form.Label><Form.Control name="titleBefore" value={form.titleBefore} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Meno</Form.Label><Form.Control name="firstName" value={form.firstName} onChange={handleChange} required /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Priezvisko</Form.Label><Form.Control name="lastName" value={form.lastName} onChange={handleChange} required /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Titul za menom</Form.Label><Form.Control name="titleAfter" value={form.titleAfter} onChange={handleChange} /></Form.Group></Col>
          </Row>

          <Row className="mt-3">
            <Col><Form.Group><Form.Label>Rodné priezvisko</Form.Label><Form.Control name="birthSurname" value={form.birthSurname} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Rodné číslo</Form.Label><Form.Control name="birthNumber" value={form.birthNumber} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Dátum narodenia</Form.Label><Form.Control type="date" name="birthDate" value={form.birthDate} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Krajina narodenia</Form.Label><Form.Control name="birthCountry" value={form.birthCountry} onChange={handleChange} /></Form.Group></Col>
          </Row>

          <Row className="mt-3">
            <Col><Form.Group><Form.Label>Štátna príslušnosť</Form.Label><Form.Control name="nationality" value={form.nationality} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Typ dokladu</Form.Label><Form.Control name="idType" value={form.idType} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Daňový domicil</Form.Label><Form.Control name="taxDomicile" value={form.taxDomicile} onChange={handleChange} /></Form.Group></Col>
            <Col>
              <Form.Group>
                <Form.Label>Rezident USA</Form.Label>
                <Form.Select name="usaResident" value={form.usaResident} onChange={handleChange}>
                  <option value="no">Nie</option>
                  <option value="yes">Áno</option>
                </Form.Select>
              </Form.Group>
            </Col>
          </Row>

          <Row className="mt-4">
            <Col><Form.Group><Form.Label>Mobil 1</Form.Label><Form.Control name="phone1" value={form.phone1} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Mobil 2</Form.Label><Form.Control name="phone2" value={form.phone2} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Pevná linka</Form.Label><Form.Control name="landline" value={form.landline} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Email</Form.Label><Form.Control name="email" value={form.email} onChange={handleChange} /></Form.Group></Col>
          </Row>

          <hr className="mt-4 mb-4" />

          <Row>
            <Col><Form.Group><Form.Label>Typ adresy</Form.Label><Form.Control name="addressType" value={form.addressType} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Ulica</Form.Label><Form.Control name="street" value={form.street} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Číslo</Form.Label><Form.Control name="houseNumber" value={form.houseNumber} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Mesto</Form.Label><Form.Control name="city" value={form.city} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>PSČ</Form.Label><Form.Control name="zip" value={form.zip} onChange={handleChange} /></Form.Group></Col>
            <Col><Form.Group><Form.Label>Štát</Form.Label><Form.Control name="country" value={form.country} onChange={handleChange} /></Form.Group></Col>
          </Row>

          <Button variant="primary" type="submit" className="mt-4 w-100">
            Uložiť profil
          </Button>
        </Form>
      </Card>
    </Container>
  );
};

export default AddEmployee;
